import React, { Component } from 'react';

class Farmer extends Component {

    constructor(props) {
        super(props);
        this.state = {farmers: []};
    }

    componentDidMount() {
        fetch('/api/farmers')
            .then(response => response.json())
            .then(data => this.setState({farmers: data}));
    }

    render() {
        return (
            <h1>Farmers</h1>
        )
            
    }

}

export default Farmer
